import React, { Component } from 'react';
class SignUpForm extends Component {
    constructor(props){
        super(props);
        this.state ={
            username: ""
        }
    }
    render(){
        return(
            <form>
                <h3>Create Account</h3>
                <label>Username:</label>
                <input
                type="text"
                name="username"
                value ={this.state.username}/>
                <label>Password:</label>
                <input
                type="text"
                name="password"/>
                <label>Email:</label>
                <input
                type="text"
                name="email"/>
                <label>First Name</label>
                <input
                type="text"
                name="firstName"/>
                <label>Last Name</label>
                <input
                type="text"
                name="lastName"/>
                <label>Country</label>
                <input/>
                <label>I agree to MYtinerary's Terms and Conditions</label>
                <input type="checkbox"/>
                <button>OK</button>
            </form>
        );
    }

}

export default SignUpForm;
